import React,{Component} from 'react';
import {Modal,Button,Row,Col,Form} from 'react-bootstrap';

export class AddEmpModel extends Component {
    constructor(props){
        super(props);
        this.state={deps:[]};
        this.handleSubmit=this.handleSubmit.bind(this);
    }
    Image="annn.png";
    imagesrc=process.env.REACT_APP_PHOTO+this.Image;

    componentDidUpdate(){
        fetch(process.env.REACT_APP_API+'department')
            .then(response=>response.json())
            .then(data=>{
                this.setState({deps:data})
            });
    }


    handleSubmit(event){
        event.preventDefault();
        fetch(process.env.REACT_APP_API+'employee',{
            method:'POST',
            headers:{
                'Accept':'application/json',
                'Content-Type':'application/json'
            },
            body:JSON.stringify({
                DepartmentId:null,
                DepartmentName:event.target.DepartmentName.value
            })
        })
        .then(res=>res.json())
        .then((result)=>{
            alert(result);
        },
        (error)=>{
            alert("Failed")
        })
    }
    render(){
        return (
            <div className="container">
                <Modal
                {...this.props}
                size="lg"
                aria-labelledby='contained-modal-title-vcenter'
                centered
                >
                    <Modal.Header closeButton>
                        <Modal.Title id="contained-modal-title-vcenter">
                            Add Department
                        </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                        <Row>
                            <Col sm={6}>
                                <Form onSubmit={this.handleSubmit}>
                                    <Form.Group controlId="DepartmentName">
                                        <Form.Label>DepartmmentName</Form.Label>
                                        <Form.Control type="text" name="DepartmentName" required placeholder="DepartmentName"/>
                                    </Form.Group>
                                    <Form.Group>
                                        <Button variant ="primary" type="submit">
                                            Add department
                                        </Button>
                                    </Form.Group>
                                </Form>
                            </Col>
                        </Row>
                    </Modal.Body>

                    <Modal.Footer>
                        <Button variant="danger" onClick={this.props.onHide}>Close</Button>

                    </Modal.Footer>

                </Modal>
            </div>
        )
    }
}
